import Vue from "vue";
import CustomChat from "@/components/CustomChat.vue";
import vuetify from "./plugins/vuetify";
import "vuetify/dist/vuetify.min.css";

export default {
  App,
};
Vue.config.productionTip = false;

new Vue({
  vuetify,
  render: (h) => h(App),
}).$mount("#app");
